import React from "react"; 

const ActiveJournalEntries = (props) => {
    let clicked = false
    const showContents = (props) => {
        clicked = true
    }
    return (
        <div>
            <button onClick={showContents}>{props.title}</button>
            {clicked = true ? <p>{props.body}</p> : <p></p>}
        </div>
    )

}

export default ActiveJournalEntries
